    "store": {"coverage.html":{"url":"coverage.html","title":"coverage - coverage","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n    Documentation coverage\n\n\n\n    \n\n\n\n    \n        \n            File\n            Type\n            Identifier\n            Statements\n        \n    \n    \n    \n\n\n\n\n\n    new Tablesort(document.getElementById('coverage-table'));\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"dependencies.html":{"url":"dependencies.html","title":"package-dependencies - dependencies","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n    \n        Dependencies\n    \n    \n        \n            @angular/animations : ~13.3.0\n        \n            @angular/common : ~13.3.0\n        \n            @angular/compiler : ~13.3.0\n        \n            @angular/core : ~13.3.0\n        \n            @angular/forms : ~13.3.0\n        \n            @angular/material : ^13.3.8\n        \n            @angular/platform-browser : ~13.3.0\n        \n            @angular/platform-browser-dynamic : ~13.3.0\n        \n            @angular/router : ~13.3.0\n        \n            cors : ^2.8.5\n        \n            rxjs : ~7.5.0\n        \n            tslib : ^2.3.0\n        \n            zone.js : ~0.11.4\n    \n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"index.html":{"url":"index.html","title":"getting-started - index","body":"\n                   \n\nMyFlixAngularClient\nThis project was generated with Angular CLI version 13.3.7.\nKey Features\n\nThe app should display a welcome view where users will be able to either log in or register an\naccount.\nOnce authenticated, the user should now view all movies.\nUpon clicking on a particular movie, users will be taken to a single movie view, where\nadditional movie details will be displayed. The single movie view will contain the following\nadditional features:\nA button that when clicked takes a user to the director view, where details about the\ndirector of that particular movie will be displayed.\nA button that when clicked takes a user to the genre view, where details about that\nparticular genre of the movie will be displayed.\n\n\nThe user will have the ability to favorite movies\nThe user can view his favorited movies on his profile page and edit/delete his user info\n\nDevelopment server\nRun ng serve for a dev server. Navigate to http://localhost:4200/. The application will automatically reload if you change any of the source files.\nCode scaffolding\nRun ng generate component component-name to generate a new component. You can also use ng generate directive|pipe|service|class|guard|interface|enum|module.\nBuild\nRun ng build to build the project. The build artifacts will be stored in the dist/ directory.\nRunning unit tests\nRun ng test to execute the unit tests via Karma.\nRunning end-to-end tests\nRun ng e2e to execute the end-to-end tests via a platform of your choice. To use this command, you need to first add a package that implements end-to-end testing capabilities.\nFurther help\nTo get more help on the Angular CLI use ng help or go check out the Angular CLI Overview and Command Reference page.\nDevelopment Process for the movies application\nInstall Angular\n\nCheck if Angular is already installed on device\nng --version\nIf not, install Angular\nnpm install -g @angular/cli\n\nCreate a new Angular project\n\nNavigate to folder and create project\nng new my-project-name\nNavigate to project folder to run project\nng serve --open\n\nSet up app to load data from movie API\n\nSet up Angular HttpClient\n  1.1. Go to app.module.ts and addimport { HttpClientModule } from '@angular/common/http';\n\n  1.2. Add HttpClientModule to the imports of @NgModule\n\nCreate Angular Service for Consuming REST API \n  2.1 Create a new Service inside app folderng generate service fetch-api-data\n\n  2.2. Add import statements to fetch-api-data.service.ts file\nimport { catchError } from 'rxjs/internal/operators';\nimport { HttpClient, HttpHeaders, HttpErrorResponse } from '@angular/common/http';\nimport { Observable, throwError } from 'rxjs';\nimport { map } from 'rxjs/operators';\nImplement services logic to make API calls\n\n\nUser registration\nUser login\nGet all movies\nGet one movie\nGet director\nGet genre\nGet user\nGet favourite movies for a user\nAdd a movie to favourite Movies\nEdit user\nDelete user and\nDelete a movie from the favorite movies\n\nAdd Angular Material to application\n\nInstall project dependency\n$ ng add @angular/material\nImport models from Angular Material to app.module.ts\n\nAdd modules to imports array to serve to other components\n\n\nCreate components for user to use application\nUsing the command:\n$ ng generate component my-component-nameStructure of components:\n\nWelcome screen\nUser registration form (signup)\nUser login form\n\n\nNavbar \nMovie Card View\nDialogs for Movie Card: \nDirector\nGenre\nSynopsis\n\n\nProfile View\nEdit profile dialog\n\n\n\nAdd routing to application\n\nImport Angular's built-in router:\nimport { RouterModule, Routes } from '@angular/router';\nAdd to app.component.html\n \nCreate routes in app.module.ts\n\n\nDeploy application on github pages\n\nIf not done yet: Create github repository for application\n\nIf also not done yet: Link the new remote repository to the local project folder. To do so, simply run this command from inside your project folder (replace  and  with your own GitHub username and repository name): git remote add origin https://github.com//.git\n\nAdd angular-cli-ghpages by running \nng add angular-cli-ghpages.\nBuild your application (i.e., generate static HTML, CSS, and JavaScript files out of your application so that browsers can interpret them without the need to use any extra tools/plugins). To do so, run the following command, replacing  with your own repository name:\n ng deploy --base-href=//.\n\nAdd compodoc Documentation\n\nInstall compodoc (if not yet installed) globally:\nnpm install -g @compodoc/compodoc\nCheck that code is commented adhering to best practices\n\nRun typedoc to create documentation:\ncompodoc -p tsconfig.app.json -s\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"modules.html":{"url":"modules.html","title":"modules - modules","body":"\n                   \n\n\n\n\n    Modules\n\n\n    \n    \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"overview.html":{"url":"overview.html","title":"overview - overview","body":"\n                   \n\n\n\n    Overview\n\n    \n\n    \n    \n\n\n \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"properties.html":{"url":"properties.html","title":"package-properties - properties","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n    \n        Properties\n    \n    \n        \n            Version : 0.0.0\n    \n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"}}
